import React, {useState} from 'react';
import '../css/test.css'

function Test({currentTab}) {

    const items = [
        { id: 1, name: 'Item1'},
        {id : 2, name: 'Item2'},
        {id: 3, name: 'Item3'},
    ]

    if (currentTab === "test") {
        return (
            <div className="test">
                Hello, world!
                <ul>
                    {items.map(item => (
                        <li key={item.id}>{item.name}</li>
                    ))}
                </ul>
            </div>
        )
    }
}

export default Test
